    JobDetailsComponent.prototype.formatDate = function (date) {
        var month = '' + (date.getMonth() + 1);
        var day = '' + date.getDate().toString();
        var year = date.getFullYear();
        if (month.length < 2)
            month = '0' + month;
        if (day.length < 2)
            day = '0' + day;
        return [year, month, day].join("-");
    };
